import "./App.css";
import Panel from "./Panel";
function App() {
  const [foremostIndex, setForemostIndex] = useState(1);
  const updateIndex = (id) => {
    setForemostIndex(foremostIndex + 1);
    document.getElementById(`panel-${id}`).style.zIndex = foremostIndex;
  };
  return (
    <div className="App">
      <Panel updateIndex={updateIndex} id={2} title="spaghetti">
        <img
          className="content"
          src="https://www.memecreator.org/static/images/memes/5402710.jpg"
          alt="131231"
          srcset=""
        />
      </Panel>
      <Panel updateIndex={updateIndex} id={3} title="text box">
        <textarea className=""></textarea>
      </Panel>
    </div>
  );
}

export default App;
